import { Collation } from '../collation';
import { Metadata } from '../metadata-parser';
import { ColumnMetadata } from './colmetadata-token-parser';
import { TokenHandler } from './handler';

export const TYPE = {
  ALTMETADATA: 0x88,
  ALTROW: 0xD3,
  COLMETADATA: 0x81,
  COLINFO: 0xA5,
  DONE: 0xFD,
  DONEPROC: 0xFE,
  DONEINPROC: 0xFF,
  ENVCHANGE: 0xE3,
  ERROR: 0xAA,
  FEATUREEXTACK: 0xAE,
  FEDAUTHINFO: 0xEE,
  INFO: 0xAB,
  LOGINACK: 0xAD,
  NBCROW: 0xD2,
  OFFSET: 0x78,
  ORDER: 0xA9,
  RETURNSTATUS: 0x79,
  RETURNVALUE: 0xAC,
  ROW: 0xD1,
  SSPI: 0xED,
  TABNAME: 0xA4
};

type HandlerName = keyof TokenHandler;

export abstract class Token {
  name: string;
  handlerName: keyof TokenHandler;

  constructor(name: string, handlerName: HandlerName) {
    this.name = name;
    this.handlerName = handlerName;
  }
}

export class ColMetadataToken extends Token {
  declare name: 'COLMETADATA';
  declare handlerName: 'onColMetadata';

  columns: ColumnMetadata[]

  constructor(columns: ColumnMetadata[]) {
    super('COLMETADATA', 'onColMetadata');

    this.columns = columns;
  }
}

export class DoneToken extends Token {
  declare name: 'DONE';
  declare handlerName: 'onDone';

  more: boolean;
  sqlError: boolean;
  attention: boolean;
  serverError: boolean;
